import csvimport os#Resources/budget_data.csvfile_load = os.path.join("Resources", "budget_data.csv")output = os.path.join("analysis", "budget_analysis.txt")#the different components of the datatotal_months = 0month_of_change = []net_change_list = []greatest_increase = ["", 0]greatest_decrease = ["", 9999999999999999999]total_net = 0with open(file_load) as budget_data:     reader = csv.reader(budget_data)    header = next(reader)    #so header isn't added to list values    first_row = next(reader)    total_net += int(first_row[1])    prev_net = int(first_row[1])    for row in reader:   #total         total_months += 1        total_net += int(row[1])   #net change         net_change = int(row[1]) - prev_net        prev_net = int(row[1])        net_change_list += [net_change]        month_of_change += [row[0]]    #greatest increase        if net_change > greatest_increase[1]:             greatest_increase[0] = row[0]            greatest_increase[1] = net_change    #greatest decrease        if net_change < greatest_decrease[1]:            greatest_decrease[0] = row[0]            greatest_decrease[1] = net_change        #average net changenet_monthly_avg = sum(net_change_list) / len(net_change_list)#analysis outputanalysis = (    f"Financial Analysis\n"    f"--------------------\n"    f"Total Months: {total_months}\n"    f"Total: ${total_net}\n"    f"Greatest Increase in Profits: {greatest_increase[0]} (${greatest_increase[1]})\n"    f"Greatest Decrease in Profits: {greatest_decrease[0]} (${greatest_decrease[1]})\n")print(analysis)with open(output, 'w') as txt_file:    txt_file.write(output)    